import React from "react";
import { receipes } from "../../items/receipes";
import "./styles.css";
import LocomotiveScroll from "locomotive-scroll";

const scroller = new LocomotiveScroll({
  el: document.querySelector("[data-scroll-container]"),
  smooth: true,
});

function Receipes() {
  return (
    <div className="receipes__wrapper" data-scroll-container>
      <section data-scroll-section>
        <h1
          data-scroll
          data-scroll-direction="horizontal"
          data-scroll-speed="-3"
          data-scroll-class="appear"
          data-scroll-repeat="true"
        >
          Receipes for the gainz
        </h1>
      </section>
      <div className="receipes__container">
        {receipes.map((receipe) => {
          return (
            <div className="receipe__container" key={receipe.id}>
              <div className="img--container">
                <img src={receipe.image} />
              </div>
              <a className="readmore" href="/">
                Read More
              </a>
              <div className="receipe__details">
                <h1>{receipe.name}</h1>
                <p>{receipe.intro}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default Receipes;
